      return instances[value];

    this.__initializeWith__(&quot;Object&quot;);
    this._class = $SC.Class(&quot;Symbol&quot;);
    this._raw = value;
    instances[value] = this;
  }

  sc.lang.klass.define(&quot;Symbol&quot;, &quot;Object&quot;, {
    constructor: Symbol,
    $new: function() {
      throw new Error(&quot;Symbol.new is illegal, should use literal.&quot;);

    __tag__: function() {
      return sc.C.TAG_SYM;
    },
    __str__: function() {
